許多旅人來到宜蘭，可能在菜市場或夜市吃過「一串心」，但可能不知道這也是宜蘭限定的獨特小吃之一喔！說到一串心要好吃的靈魂，就需要這種台語稱為豆腐殼、膨仔、炸豆干的空心豆腐乾作為基底。鋪上香菜或九層塔，再夾上香腸、鴨賞、粉肝、紅燒肉等熟食好物，最後用一根牙籤串起來。吃的時候要沾上蒜茸醬油膏、甜辣醬或是宜蘭特有的紅味噌醬一起品嚐。道地的一串心小吃攤上，在地人會在攤前吃完一串串的一串心之後，拿著牙籤依照數量跟老闆結帳。有趣的事，從宜蘭溪北走到溪南地區，豆腐殼的形狀還會從四方形變成三角形喔！

